import React from "react";
import logo from "../images/logo.png";
import left from "../images/left.png";
import mid from "../images/mid.png";
import rigth from "../images/rigth.png";
const Menu = () => {
  return (
    <div
      style={{
        height: "100vh",
        alignItems: "space-evenly",
        display: "flex",
        flexDirection: "column",
      }}
    >
      <div
        style={{
          width: "100%",
          display: "flex",
          gap: "40px",
          justifyContent: "flex-end",
          marginTop: "66px",
          alignItems: "center",
        }}
      >
        <p style={{ fontSize: "25px", color: "#02B589", lineHeight: "23px" }}>
          Хэрхэн ажилладаж вэ?
        </p>
        <button
          style={{
            marginRight: "123px",
            fontSize: "20px",
            borderRadius: "100px",
            width: "183px",
            height: "44px",
            backgroundColor: "#02B589",
            border: "none",
            color: "white",
          }}
        >
          Нэвтрэх
        </button>
      </div>
      <div
        style={{
          width: "100%",
          height: "100%",
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        <div style={{ display: "flex", alignItems: "center" }}>
          <img src={left} />
          <img src={mid} />
          <img src={rigth} />
        </div>
        <img src={logo} />
      </div>
      <div
        style={{
          display: "flex",
          gap: "16px",
          width: "100%",
          justifyContent: "center",
        }}
      >
        <input
          placeholder="https://www.web-huudas.mn"
          style={{
            fontSize: "20px",
            width: "581px",
            height: "44px",
            borderRadius: "100px",
            border: "1px solid grey",
          }}
        />
        <button
          style={{
            width: "192px",
            height: "44px",
            border: "none",
            backgroundColor: "#02B589",
            borderRadius: "100px",
            color: "white",
            fontSize: "20px",
          }}
        >
          Богиносгох
        </button>
      </div>
      <div
        style={{
          display: "flex",
          alignItems: "center",
          flexDirection: "column",
          width: "100%",
        }}
      >
        <p style={{ fontSize: "16px" }}>
          Made with ♥️ by Pinecone Academy ..BTK
        </p>
        <p style={{ fontSize: "16px", color: "grey" }}>©boginoo.io 2020</p>
      </div>
    </div>
  );
};
export default Menu;
